class Rectangle:
    def __init__(self, a, b):
        self.a = a
        self.b = b

    def area(self):
        return self.a * self.b

    def perimeter(self):
        return 2 * (self.a + self.b)


a = float(input("Enter side a: "))
b = float(input("Enter side b: "))
rect = Rectangle(a, b)

print(f"Area: {rect.area()}")
print(f"Perimeter: {rect.perimeter()}")
